We start by creating a component that uses the parameters value. We can get the current state of the router using the use_route hook. From that state we can extract the current value of our parameter by using a key we will later also define on our route. It is VERY IMPORTANT to drop the object returned by the use_route hook once our component finished rendering. Otherwise the entire router will be frozen. The use_route hook can only be used in components nested within a component that called use_router . # // Hidden lines (like this one) make the documentation tests work.
# extern crate dioxus;
use dioxus::prelude::*;
# extern crate dioxus_router;
use dioxus_router::prelude::*; struct Name; fn Greeting(cx: Scope) -> Element { let route = use_route(cx).expect("is nested within a Router component"); let name = route.parameter::<Name>() .map(|name| name.clone()) .unwrap_or(String::from("world")); render! { p { "Hello, {name}!" } }
}

