# fn Settings(cx: Scope) -> Element { unimplemented!() }
# fn GeneralSettings(cx: Scope) -> Element { unimplemented!() }
# fn PasswordSettings(cx: Scope) -> Element { unimplemented!() }
# fn PrivacySettings(cx: Scope) -> Element { unimplemented!() } fn GlobalFallback(cx: Scope) -> Element { render! { h1 { "Error 404 - Page Not Found" } }
} fn SettingsFallback(cx: Scope) -> Element { render! { h1 { "Error 404 - Settings Not Found" } }
