This code will create a crash due to an unterminated recursion using Outlet s. # // Hidden lines (like this one) make the documentation tests work.
# extern crate dioxus;
# use dioxus::prelude::*;
# extern crate dioxus_router;
# use dioxus_router::prelude::*;
#
fn Content(cx: Scope) -> Element { render! { h1 { "Heyho!" } Outlet { depth: 0, } }
} fn App(cx: Scope) -> Element { use_router(cx, &Default::default, &|| Segment::content(comp(Content))); render! { Outlet { } }
} The Outlet in the App component has no parent Outlet , so its depth will be 0. When rendering for the path /, it therefore will render the Content component. The Content component will render an h1 and an Outlet . That OUtlet would usually have a depth of 1, since it is a descendant of the Outlet in the App component. However, we override its depth to 0, so it will render the Content component. That means the Content component will recurse until someone (e.g. the OS) puts a stop to it.

