We can use the Navigator to trigger four different kinds of navigation: push will navigate to the target. It works like a regular anchor tag. replace works like push, except that it replaces the current history entry instead of adding a new one. This means the prior page cannot be restored with the browsers back button. Go back works like the browsers back button. Go forward works like the browsers forward button (the opposite of the back button). # // Hidden lines (like this one) make the documentation tests work.
